import React from 'react';

function AboutPage() {
  return (
    <div style={{ padding: '20px', textAlign: 'center' }}>
      <h1>About Us</h1>
      <p>This is a sample about page for a React SPA. It's designed to give visitors insight into what this application is about and who it's for.</p>
      <p>Here, you can add more detailed information about your project, its goals, the team behind it, or any other relevant information you wish to share.</p>
      {/* Additional content such as images, videos, team bios, etc., can be added here */}
    </div>
  );
}

export default AboutPage;
